  false,\n\t\"url\": null,\n\t\"notes\": \"The nearshore sensors are part of the Pacific
  Islands Ocean Observing System (PacIOOS) and are designed to measure a variety of
  ocean parameters at fixed point locations. NS05 is located at the Department of
  Marine and Wildlife Resources (DMWR) dock in Pago Pago Harbor, American Samoa and
  is mounted to the bottom in about 2 meters of water. The instrument is a Sea-Bird
  Electronics model 16+ V2 coupled with a WET Labs ECO-FLNTUS combination sensor.\",\n\t\"license_title\":
